S DE CRISTAL DE SAL y IONIZACION DEL AIRELas lámparas de sal emiten iones negativos tanto de día como de noche permitiendo equilibrar nuestra vida, estos iones negativos se pegan a los positivos es decir lampara de sal ioniza aquellos que ya han perdido sus moléculas oxigeno, neutralizándolos y purificando el aire del ambiente donde se encuentren estas maravillosas lámparas. Siendo las zonas urbanas las mas cargadas de iones positivos. El hermoso color naranja, el más cercano al color de la luz, que emite las lámparas de sal nos proveen de bienestar al crear un ambiente equilibrado, tranquilo, relajado, perfecto para estimular nuestra concentración y meditación.Especificaciones :- Peso: 2-3 kg.- Medida: puede variar por la conformación natural de la roca.- Color ~7 \".- Sal de roca.- Temperatura de color 100 ° C.- Hecho en pakistan .Incluye:- Lampara de sal con base de madera.- Cable 220 volts con soquete para ampolleta.- Ampolleta.',22990,'$','2020-08-28','Otros artículos del hogar','Super Práctico_XIV_Valdivia'),('https://www.yapo.cl/los_rios/articulos-del-hogar/lampara_de_sal_del_himalaya_piedra_2_a_3_kg_74028112.htm?ca=11_s&oa=74028112&xsp=3','Lampara De Sal Del Himalaya Piedra 2 a 3 Kg','Práctico Av. Francia 191, Valdivia.- Retiro en tienda o envío a domicilio wsp +56983238587- Lunes a sábado 10 a 18 hrs.Características: Las lámparas de cristal de sal son formadas íntegramente por la naturaleza siendo cada una única en cuanto a color y forma en la que se introduce una lámpara incandescente de manera que, gracias a las propiedades ópticas del mineral, se ilumina en su totalidad. Entre los tipos de sal con que son fabricadas dichas lámparas podemos encontrar de litio, selenita, halita, colpa común blanca, roja, amarilla.LÁMPARAS DE CRISTAL DE SAL y IONIZACION DEL AIRELas lámparas de sal emiten iones negativos tanto de día como de noche permitiendo equilibrar nuestra vida, estos iones negativos se pegan a los positivos es decir lampara de sal ioniza aquellos que y